import React from 'react';

const Navi = (props) => {
  return (
    <div className="Navi">
      <nav>
        <li>Home</li>
        <li>Technologies</li>
        <li>Projects</li>
        <li>Contact</li>
      </nav>
    </div>
  );
};
export default Navi;
